    return (

       


        <div>
                <h2>Let's get started</h2>
                <ExpenseItem>
                    data = {expenseDate} 
                  title = {expenseTitle} 
                  amount = {expenseAmount}
                </ExpenseItem>
        </div>
        
    
    );
}

export default App;
